import React from "react";
import { createGlobalStyle } from "styled-components";
import Main from "./pages/Main/Template";
const GlobalStyle = createGlobalStyle`
  body{
    margin:0;
    padding:0;
  }
`;

function App() {
  return (
    <>
      <GlobalStyle />
      <Template />
    </>
  );
}

export default App;
